import Head from "next/head";

function Home() {
  return (
    <>
      <Head>
        <title>My Next.js Site!</title>
        <meta name="viewport" content="initial-scale=1.0, width=device-width" />
      </Head>
      <div>Welcome, Explorer!</div>
    </>
  );
}

export default Home;
